@tool
def get_file_tree(max_depth: int = 5) -> str:
    """
    Get the file tree of the current project directory.
    Excludes common non-code directories.
    
    Args:
        max_depth: Maximum depth to traverse (default: 5)
    
    Returns:
        String representation of the file tree
    """
    try:
        excluded_dirs = {
            '__pycache__', '.venv', 'venv', 'env', '.env',
            'node_modules', '.git', '.idea', '.vscode',
            'build', 'dist', '.pytest_cache', '.mypy_cache',
        }
        
        def should_exclude(path: Path) -> bool:
            return any(excluded in path.parts or path.name.startswith('.') 
                      for excluded in excluded_dirs)
        
        def build_tree(directory: Path, prefix: str = "", depth: int = 0) -> List[str]:
            if depth > max_depth:
                return []
            
            lines = []
            try:
                items = sorted(directory.iterdir(), key=lambda x: (not x.is_dir(), x.name))
                items = [item for item in items if not should_exclude(item)]
                
                for i, item in enumerate(items):
                    is_last = i == len(items) - 1
                    current_prefix = "└── " if is_last else "├── "
                    lines.append(f"{prefix}{current_prefix}{item.name}")
                    
                    if item.is_dir():
                        extension = "    " if is_last else "│   "
                        lines.extend(build_tree(item, prefix + extension, depth + 1))
            except PermissionError:
                pass
            
            return lines
        
        cwd = Path.cwd()
        tree_lines = [f"{cwd.name}/"]
        tree_lines.extend(build_tree(cwd))
        
        return "\n".join(tree_lines)
        
    except Exception as e:
        return f"Error getting file tree: {str(e)}"


@tool
def read_file(filepath: str) -> str:
    """Read the contents of a file."""
    try:
        path = Path(filepath).resolve()
        cwd = Path.cwd().resolve()
        
        if not str(path).startswith(str(cwd)):
            return f"Security error: Cannot access files outside project directory"
        
        if not path.exists():
            return f"Error: File not found: {filepath}"
        
        content = path.read_text(encoding='utf-8')
        return f"{filepath}\n{'='*60}\n{content}"
        
    except Exception as e:
        return f"Error reading file: {str(e)}"


@tool
def run_terminal_command(command: str) -> str:
    """Execute a terminal command in the project directory.
    
    This tool can execute ANY terminal command including complex scripts, loops, and system operations.
    Dangerous commands (delete, format, etc.) will require user approval before execution.
    
    Args:
        command: Any valid shell command. Supports bash/PowerShell syntax, pipes, loops, etc.
                 Examples: "ls -la", "for i in {1..5}; do echo $i; done", "Get-Process"
                 
    Returns:
        Command output or error message
        
    Note: Commands run in the project root directory with full shell capabilities.
    """
    try:
        # Get current working directory for context
        cwd = Path.cwd()
        
        # Determine shell based on platform
        import platform
        is_windows = platform.system() == 'Windows'
        
        # Detect potentially dangerous commands that need approval
        dangerous_patterns = [
            'rm -rf', 'rm -r', 'del /f', 'del /s', 'rmdir /s', 'rmdir /q',
            'format', 'mkfs', 'dd if=', 'fdisk', 'diskpart',
            'shutdown', 'reboot', 'restart-computer',
            'kill -9', 'taskkill /f', 'stop-process -force',
            '> /dev/sd', 'chmod 777', 'chown root'
        ]
        
        is_dangerous = any(pattern in command.lower() for pattern in dangerous_patterns)
        
        if is_dangerous:
            # Request human approval for dangerous commands
            print(f"\n[WARNING] DANGEROUS COMMAND DETECTED")
            print(f"Working Directory: {cwd}")
            print(f"Command: {command}")
            print(f"\nThis command could:")
            print("  • Delete files or directories")
            print("  • Modify system settings")
            print("  • Terminate processes")
            print("  • Cause data loss")
            
            approval = input("\n❓ Do you approve this command? (yes/no): ").strip().lower()
            
            if approval not in ['yes', 'y']:
                return f"❌ Command rejected by user: {command}"
            
            print("✅ Command approved, executing...\n")
        
        # Execute command with full shell capabilities
        # On Windows, use cmd.exe by default for better compatibility with standard commands like 'mkdir'
        
        shell_executable = None
        if is_windows:
            # Check if command looks like PowerShell or common Linux-style aliases that work better in PS
            ps_indicators = [
                'Get-', 'New-', 'Set-', 'Write-Host', 'while (', '${', 
                'Select-Object', 'Where-Object', 'ForEach-Object', 'Start-Sleep', 
                'Write-Output', 'Sleep', 'date', 'time', 'ls', 'cat', 'curl', 'wget', 'clear', 'pwd'
            ]
            if any(indicator in command for indicator in ps_indicators) or command.strip().startswith('while'):
                shell_executable = 'powershell.exe'
            
            # If still using cmd.exe, fix common batch file syntax issues
            if shell_executable is None and '%%' in command:
                command = command.replace('%%', '%')
        else:
             shell_executable = '/bin/bash'

        # Visual feedback for the command
        try:
            from colorama import Fore, Style
            print(f"\n{Fore.CYAN}➜ {command}{Style.RESET_ALL}", flush=True)
        except ImportError:
            print(f"\n➜ {command}", flush=True)

        # Use Popen for real-time output streaming
        import time
        import os
        
        # Force unbuffered output for Python and other tools
        env = os.environ.copy()
        env['PYTHONUNBUFFERED'] = '1'
        
        process = subprocess.Popen(
            command,
            shell=True,
            stdout=subprocess.PIPE,
            stderr=subprocess.STDOUT, # Merge stderr into stdout
            text=False, # Binary mode to avoid buffering
            cwd=str(cwd),
            executable=shell_executable,
            bufsize=0, # Unbuffered
            env=env
        )
        
        # Determine color based on config (default to Cyan if not found)
        try:
            from colorama import Fore, Style
            # Simple mapping based on common schemes
            scheme_colors = {
                'dracula': Fore.CYAN,
                'matrix': Fore.GREEN,
                'cyberpunk': Fore.YELLOW,
                'monokai': Fore.WHITE,
                'default': Fore.BLUE
            }
            # Try to get scheme from global config if available, else default
            current_scheme = AGENT_CONFIG.get('color_scheme', 'default')
            term_color = scheme_colors.get(current_scheme, Fore.WHITE)
        except:
            term_color = ""
            
        output_lines = []
        start_time = time.time()
        
        # Apply color once at start
        if term_color:
            sys.stdout.write(term_color)
            sys.stdout.flush()
        
        try:
            while True:
                # Read byte by byte
                byte = process.stdout.read(1)
                
                if byte:
                    try:
                        char = byte.decode('utf-8', errors='replace')
                        sys.stdout.write(char)
                        sys.stdout.flush()
                        output_lines.append(char)
                    except:
                        pass
                else:
                    # No data, check if process ended
                    if process.poll() is not None:
                        break
                    time.sleep(0.01) # Prevent busy wait
                
                if time.time() - start_time > 60:
                    process.kill()
                    return "❌ Command timed out (60s limit)"
                    
        except Exception as e:
            try:
                process.kill()
            except:
                pass
            return f"❌ Error during execution: {str(e)}"
            
        return_code = process.poll()
        combined_output = "".join(output_lines)
        status = "✓" if return_code == 0 else "✗"
        
        # Reset color and notify user
        try:
            from colorama import Style, Fore
            sys.stdout.write(Style.RESET_ALL)
            sys.stdout.flush()
            print(f"\n{Fore.GREEN}✓ Command finished. Processing results (this may take a moment)...{Style.RESET_ALL}", flush=True)
        except:
            pass

        # Truncate output for LLM context if too long (user already saw full output)
        llm_output = combined_output
        if len(combined_output) > 2000:
            llm_output = combined_output[:2000] + "\n... (output truncated for agent context) ..."

        return f"{status} Executed in {cwd.name}\nExit Code: {return_code}\n{llm_output}"
        
        # Verify if directory was created if command looks like mkdir
        verification = ""
        if return_code == 0 and (command.strip().lower().startswith("mkdir ") or command.strip().lower().startswith("md ")):
             parts = command.strip().split()
             if len(parts) > 1:
                 # Handle quoted paths
                 import shlex
                 try:
                    parts = shlex.split(command)
                    target_name = parts[-1]
                    target_dir = cwd / target_name
                    if target_dir.exists():
                        verification = f"\n✅ Verified: Directory '{target_name}' created successfully."
                    else:
                        verification = f"\n⚠️ Warning: Directory '{target_name}' not found after creation."
                 except:
                    pass

        return f"{status} Executed in {cwd.name}\nExit Code: {return_code}\n{combined_output}{verification}"
        
    except Exception as e:
        return f"❌ Error executing command: {str(e)}"


