        if AGENT_CONFIG["provider"] == "ollama":
            try:
                from langchain_ollama import ChatOllama
                print(f"Using Ollama model: {AGENT_CONFIG['model']}")
                self.model = ChatOllama(
                    model=AGENT_CONFIG["model"],
                    temperature=AGENT_CONFIG["temperature"],
                    num_ctx=AGENT_CONFIG["context_window"],
                )
            except ImportError:
                print("[ERROR] langchain-ollama not installed. Please install it with: pip install langchain-ollama")
                raise
        else:
            # Default to Groq
            from langchain_groq import ChatGroq
            self.model = ChatGroq(
                model=AGENT_CONFIG["model"],
                temperature=AGENT_CONFIG["temperature"],
                max_tokens=AGENT_CONFIG["max_tokens"],
            )
        
        # Collect tools
        self.tools = []
        self._add_tools()
        
        # Create LangGraph agent with system prompt
        self.agent = create_react_agent(
            self.model,
            self.tools,
            prompt=SystemMessage(content=system_prompt)
        )
        
        print(f"\n{AGENT_CONFIG['display_name']} Initialized")
        print(f"Project: {self.project_root}")
        print(f"Memory: {'Enabled' if enable_memory else 'Disabled'}")
        print(f"RAG: {'Enabled' if AGENT_CONFIG['rag_enabled'] else 'Disabled'}")
        print(f"Tools: {len(self.list_tools())}")
        print()
    
